import React from 'react'
import { Container } from 'react-bootstrap'
const MovieOne = ({ data }) => {
    const title = data.list[0].page.title
    const contentitems = data.list[0].page["content-items"]
    const content = contentitems['content'];
    console.log(content)
    return (
        <div>
            <Container>
                <h4 className="m-0 py-3">{title}</h4>
            </Container>
            <hr className="m-0 mb-3" />
            <Container>
                {content.map((items, index) => {
                    return (
                        <li key={index}>
                            <img src={'/Slice/' + items['poster-image']} />
                            {items.name}
                        </li>

                    )
                })}

                <pre>
                    {JSON.stringify(data)}
                </pre>
            </Container>
        </div>
    )
}

export default MovieOne
